import { NavigationContainer } from "@react-navigation/native";
import { createStackNavigator } from "@react-navigation/stack";
import Cabezera from "./src/componentes/Cabezera";
import LoginForm from "./src/componentes/LoginForm";
import Saludar from "./src/componentes/Saludar";
import Menu from "./src/componentes/Menu";
const Stack = createStackNavigator();

const App = () => {
  return (
    <NavigationContainer>
      <Stack.Navigator
        screenOptions={{
          header: ({ navigation }) => <Cabezera />,
        }}
      >
        <Stack.Screen name="Login" component={LoginForm} />
        <Stack.Screen name="Saludar" component={Saludar} />
        <Stack.Screen name="Menu" component={Menu} />
      </Stack.Navigator>
    </NavigationContainer>
  );
};

export default App;
